function simulateKey(KeyCode) {
let key = new java.lang.Thread(new java.lang.Runnable({
run: function() {
try {
let runkey = new android.app.Instrumentation;
runkey.sendKeyDownUpSync(KeyCode);
} catch(e) {
print(e)
}
}
}));
key.start();
}

