function killauraActiveAt(ent) {
try{
if(ent != null) {
clickTick++;
if(clickTick == 4) {
simulateKey(45);
}
if(clickTick == 8) {
simulateKey(45);
}
if(clickTick == 12) {
simulateKey(45);
clickTick = clickSpeed;
}
}
}catch(err) {
print(err);
}
}

